  const [transactions, setTransactions] = useState([])

  useEffect(()=> {
    fetch('https://2eh1oighrk.execute-api.eu-west-1.amazonaws.com/dev/transactions')
      .then(response=> response.json())
      .then(data => console.log("DATA DATA ", data));
    // console.log(count)
  },[]) // if you add count, only run if count changes.

  return (
    <div className="root">
      <ListUI data={transactions}/>
    </div>
  )
}

export default App;
